  04> WILLIAMS, Mark Charles
  b 26.07.1973
  Mark was educated at Huntley School and Wanganui Collegiate School. He was cox in the college ist
  rowing VIII. After leaving school, he worked as a tutor at Junior King's College, Canterbury,
  Kent, England for a year then spent a year working at various jobs in the UK, including six months
  as a greenkeeper at the Lambourne Golf Course. He is currently studying at Massey University for a
  degree in Applied Science in preparation for a career in the sports turf industry.
  02> WILLIAMS, Richard Alister m on 04.03. 1967 to PEARCE, Susan Elizabeth
  (Buzz)
  b 24.03.1942
  b 29.01.1945 ·
  Richard b. at Wellington. Susan, d/o HC Pearce and Patricia R Bunny, b. at Carterton. Address: Little
  Avondale Stud, Morris Road, RD 6, Masterton.
  Richard was educated at Wanganui Collegiate School then worked on a cropping farm at Ashburton before
  going overseas. In England he worked at Lady Buchanan's Lordship and Edgerton stud, gaining experience
  in the breeding and rearing of thoroughbreds. He now farms at "Little Avondale", the property Alister
  and Nancy retired to, where the Te Parae Thoroughbred Stud is now located, and under its new name
  Little Avondale Thoroughbreds. His son Sam who is in partnership with him, manages the Stud and the
  stallion Carolingian.
  01> WILLIAMS, Alister Samuel
  b 15.05.1970
  Samuel b. at Masterton. Address: Little Avondale, Morris Road, RD 6, Masterton.
  Samuel was educated at Wainuioru School then Huntley Preparatory School, Marton where he was in the
  1st cricket XI (1982-83), the 1st rugby XV (1982-83 and captain in 1983) and the 1st hockey XI
  (1982-83 and captain both years). He was Deputy Head Prefect in 1983. He went on to Wanganui
  Collegiate School (1984-88) where he was in the 1st rugby XV and the 1st cricket XI (1987-88) and
  Head of Hadfield House and a School Prefect in 1988.
  He worked on Cambridge Stud in 1989 then attended Lincoln College (1990-92), gaining a Diploma in
  Farm Management in 1993. He worked at Fayette Park Stud in 1992, travelled overseas in 1993 then
  returned to manage Little Avondale Stud in partnership with his father in 1994.
  02> WILLIAMS, Anna Elizabeth
  b 13.01.1976
  Anna b. at Masterton. She was educated at Wainuioru School (1981-84) then went to Hadlow
  Preparatory School (1985-86) where she was Head Girl in 1986 and a member of the netball team. She
  went on to St Mathew's Collegiate School, played hockey for the Junior 1st XI and was also a
  Wairarapa Primary School hockey rep. Whilst attending Woodford House (1989-92) she played for the
  1st hockey XI (1989-93 and as captain in 1992-93) and also played representative hockey for Hawkes
  Bay in 1989-93. She also represented her school at softball and cricket and was Sports Captain and
  a Prefect in 1993. She attended Massey University (1994-97) and represented New Zealand
  Universities at hockey in 1994. She enjoys riding and in 1987 she was chosen for the
  Wellington-Wairarapa equestrian team to compete in a three-day event. She has helped with the Stud
  at the National Yearling Sales at Karaka.
  Anna graduated from Massey with a Bachelor of Business Studies and a Diploma in Public Relations.
  03> WILLIAMS, James George
  b 19.09.1977
  George b. at Masterton, George was educated at Wainuioru School (1982-86) and Huntley Preparatory
  School, Marton (1987-90) where in 1990 he played for the 1st rugby XV and the 1st cricket XI and
  was Head Prefect. He went on to Wanganui Collegiate School (1991-94) and made the 1st rugby XV
  until an injury prevented any more sport in 1995 and 1996. He worked at "Wairere" station, a
